  return (
    <PageWrapper >
      <Nav/>
      {/* <Home/> */}
      <Projects/>
    </PageWrapper>
  );

}

export default Site;


const PageWrapper = styled.div`
display: grid;
grid-template-rows: 3rem 1fr;
grid-gap: 1rem;
grid-template-areas: 
'nav'
